window.bookSummaryJSON = "<p><b>The crowns of Forsyth Royalty aren’t built with jewels. They’re forged in blood and sacrifice.</b></p> <p>The Lords never expected Story Austin to walk back into their life.</p> <p>They certainly never thought she’d rise to be their Queen.</p> <p>But they aren’t the only Royals in Forsyth.</p> <p>The Dukes are known for winning with their fists, but transforming Lavinia Lucia from the Kings’ captive to their unwilling Duchess will be their biggest match yet.</p> <p><b>The saga continues in book four of the contemporary, dark, reverse harem romance Royals of Forsyth series, where the Duke’s reign will be one of </b><b><i>Ruin, Fury and Madness</i></b><b>.</b></p>"; 
